yone else is crying and whining about gas prices and high energy costs - you will have an unlimited supply of solar power. Unless the sun blows up and destroys our entire solar system - you won't really need to worry about never having power.<\/p><h3>Tax Incentives<\/h3><p>Once you invest into solar, you are eligible for Federal, State, Provincial And Utility Tax incentives and rebates. These aren't the'$30 off' from your coffee maker rebates - they add up big time! For example, in Australia, if you spend $16,000 on a solar set up, they will rebate you up to $8000 back. This doesn't include other rebates you can get either. You'll need to check your own country's government policies - but, in the next 5-10 years - all countries will be jumping on the solar bandwagon.<\/p><h3>Not Just A 'One Time' Set Up + Easy Installation<\/h3><p>With solar, you don't need to invest into a bunch of costly arraysrightaway. You're able to set up one panel at a time, and add additional panels whenever you feel the time is right. Furthermore,installing a solar panel is actually quite a lot easier than peoplethink. You can do it yourself, or have an installer come and have itset up for you the same day.<\/p><\/div>"));$B(b,50,d);_B(b)};_.cM={10:1,19:1};_=RN.prototype=QN.prototype=new u;_.gC=function SN(){return rp};_.hc=function TN(a){var b,c,d,e;b=new bC;d=lk(a.f,41);c=this.a.G;e=xd(d.x)+$wnd.pageYOffset+10;ez(b,new sA(c));$B(b,50,e);_B(b)};_.cM={10:1,19:1};_.a=null;_=$N.prototype=UN.prototype=new Nu;_.gC=function _N(){return sp};var VN;_=dO.prototype=aO.prototype=new rw;_.gC=function eO(){return tp};var bO=null;_=pO.prototype=fO.prototype=new u;_.gC=function qO(){return vp};_.tS=function rO(){return oO(this)};_.cM={46:1,70:1};_.e=null;_.f=null;_.g=null;_.i=null;_.j=null;_.k=null;_=vO.prototype=sO.prototype=new u;_.gC=function wO(){return wp};_.tS=function xO(){return uS+rP(this.a)+tS};_.cM={46:1};_.a=null;_=LO.prototype=yO.prototype=new u;_.gC=function MO(){return xp};_.tS=function NO
